import React from "react";

const LogoCenter = () => {
  return (
    <div className="mx-auto">
      <img
        src="./img/race22.png"
        alt="participate 2022"
        style={{ height: "10%", width: "10%" }}
        className="mt-5"
      />
    </div>
  );
};

